"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[8929],{4211:function(e){e.exports=JSON.parse('{"title":"GitHub Brasil \u2014 Open Source Friday","slug":"github-brasil-open-source-friday","date":"2025-03-14","authors":["Weslley Ara\xfajo"],"tags":["Brazil","Online"],"content":"\\n\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::\\n\\n{/* truncate */}\\n\\n<hr />\\n\\nDuring the live session, I was able to share a bit about myself, the importance of open source, motivations, challenges, and future plans for [Poku](https://github.com/wellwelwel/poku), as well as give some great tips for those who want to contribute for the first time, especially for those who feel insecure.\\n\\nIn one hour of live streaming, there were conversations, low vs. too-high microphone volume, explanations about module systems, and the differences in behavior between **Node.js**, **Bun**, and **Deno**.\\n\\nThere was even live coding, demonstrating in practice why other test runners are not fully compatible with all JavaScript backends and how **Poku** challenges more than 12 years of language history by bringing JavaScript\'s natural flow to testing.\\n\\n:::tip\\n\\n[You can replay the live session on the official **GitHub Brasil** **LinkedIn** \ud83d\udc37](https://www.linkedin.com/events/7305618122546294807/comments/)\\n\\n:::\\n","filePath":"github-brasil.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/03/14/github-brasil.mdx","summary":[],"description":"\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/03/14/banner.png","readingTime":1,"lastModified":"2026-01-09T20:09:42.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","slug":"winx-day-luciano-dii-souza-o-primo-dev","description":"\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/06/14/banner.png"},"nextArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg","description":"\ud83c\udf99\ufe0f **Talk:** Overcoming the impostor syndrome and the challenges of existing in the industry through open-source.\\n\\n:::note Summary\\nAt a time when many developers feel insecure about the future of the field, bringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting:\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2024/11/23/banner.png"},"route":"talks"}')}}]);